import React, { useEffect } from "react";
import * as API from "../../utils/api";
import DisplayTodo from "./DisplayTodo";

const Index = ({ todos }) => {
  useEffect(() => {
    API.getTodos()
      .then((response) => {
        console.log(response.data);
      })
      .catch(function (error) {
        console.log(error);
      })
      .finally(function () {});
  }, []);
  return (
    <>
      <table>
        <thead>
          <tr>
            <th>Id</th>
            <th>Title</th>
          </tr>
        </thead>
        <tbody>
          {todos.map((todo) => (
            <tr key={todo.id}>
              <td>{todo.id}</td>
              <td>{todo.title}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </>
  );
};

export default Index;
